cy.fixture('stores').then(stores => {
  stores.forEach(store => {
    cy.visit(store, {
      failOnStatusCode: false
    }, {
      responseTimeout: 10000
    }, {
      followRedirect: true
    });
    cy.acceptCookies();
    cy.addProductToBasket();
    cy.productSizer();
    cy.basketValidation();
    cy.intercept({
      method: 'POST',
      url: 'https://stage-data.hipay.com/checkout-data'
    }).as('hipayDataValidation');
    // Customer registration
    cy.validateElement('[data-cy="customer-registration"]').get('[data-cy="customer-registration"]').should('be.visible').click({
      force: true
    }).customInfo().validateElement('[data-cy=submit] > .c-btn').get('[data-cy=submit] > .c-btn').click({
      force: true
    });
    // Add new shipping addresse and proceed to basket checkout
    cy.customerShippingAddress.addShippingAddresse().fillAddressBasedOnUrl();
    cy.selectShippingMethod();
    cy.frictionlessCreditCardPayment();
    // Credit card payment and purchase validation
    cy.validateElement('.c-confirm__header', {
      timeout: 20000
    });
    cy.validateElement('.c-confirm__title', {
      timeout: 20000
    });
    cy.validateElement('.c-confirm__subtitle', {
      timeout: 20000
    });
    cy.validateElement('.c-confirm-shipping', {
      timeout: 20000
    });
    cy.visit(store + '/account/history');
    cy.get(':nth-child(1) > .c-order-item', {
      timeout: 20000
    }).should('have.length.gt', 0);
  });
});
